Ext.data.JsonP['Mobile_Backend_Services_FAQ']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Mobile Backend Services FAQ</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-51250815\" class=\"content\">\n                        <h1>Mobile Backend Services FAQ</h1>\n    <p>This document provides questions and answer for several frequently asked questions about MBS.    </p>\n    <div class=\"section section-2 \" id=\"src-51250815_MobileBackendServicesFAQ-ErrorenablingCloudserviceforproject\">\n        <h2 class=\"heading \"><span>Error enabling Cloud service for project</span></h2>\n    <p>If you receive a message similar to &quot;Error enabling Cloud service for project&quot; in Studio when trying to enable Cloud services for your project, the Mobile Backend Services (MBS) server may be down or Studio is unable to connect to the MBS server. Try to enable Cloud services later.    </p>\n    <p>See <a class=\"document-link \" href=\"#!/guide/Troubleshooting_Guide-section-src-49153865_TroubleshootingGuide-ErrorenablingCloudserviceforproject\">Troubleshooting Guide</a> for more details.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51250815_MobileBackendServicesFAQ-Pushnotificationerrormessages\">\n        <h2 class=\"heading \"><span>Push notification error messages</span></h2>\n    <p>Apple Push and Google Cloud Messaging provide error codes for common push notification errors. See <a class=\"document-link \" href=\"#!/guide/Troubleshooting_Guide-section-src-49153865_safe-id-VHJvdWJsZXNob290aW5nR3VpZGUtQXBwbGVQdXNoTm90aWZpY2F0aW9uU2VydmVyKEFQTlMpZXJyb3Jz\">Apple Push Notification Server errors</a> and <a class=\"document-link \" href=\"#!/guide/Troubleshooting_Guide-section-src-49153865_safe-id-VHJvdWJsZXNob290aW5nR3VpZGUtR29vZ2xlQ2xvdWRNZXNzYWdpbmcoR0NNKWVycm9ycw\">Google Cloud Messaging errors</a> for more details.    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=51250815\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Mobile Backend Services FAQ"});